import React from 'react';
import CardTarun from './Card';
import { Link } from 'react-router-dom';

class TarunQuiz extends React.Component{

  constructor(props) {
    super(props);
    this.state = {
      cardsTarun:
        { question: "spade" , answer: "5" }
    };
  }

  render(){
    return(
      <div>
      TarunQuiz
      <br/>
        <CardTarun number = "3"/>
        <br/><br/>
        <Link to="/">Go home!</Link>
      </div>
    );
  }
}

export default TarunQuiz;
